    role_token = authenticate_client_key_role()['access_token']
    def getHeadersAuth():
        http_headers = {"Authorization": 'Bearer ' + role_token,
                        "Content-Type": "application/json; charset=UTF-8"
                        }
        return http_headers
    role_http_header = getHeadersAuth()
    requestUrl = "https://management.azure.com/subscriptions/0e770625-18d4-4516-b4d9-56294d766292/resourceGroups/OICT-PSGD-DATA-ADC-PROD-RG/providers/Microsoft.Purview/accounts/sys-purview-prod/providers/Microsoft.Authorization/roleAssignments?api-version=2015-07-01&$filter=assignedto('"+request.args['guid']+"')"
    r = requests.get(requestUrl, headers = role_http_header)
    role_ids = []
    for i in r.json()['value']:
        role_ids.append(i['properties']['roleDefinitionId'].split('/')[-1])
    response = {}
    if "8a3c2885-9b38-4fd2-9d99-91af537c1347" in role_ids:
        response['curator'] = True
    else:
        response['curator'] = False
    if "8e3af657-a8ff-443c-a75c-2fe8c4bcb635" in role_ids:
        response['owner'] = True
    else:
        response['owner'] = False
    if "b24988ac-6180-42a0-ab88-20f7382dd24c" in role_ids:
        response['contributor'] = True
    else:
        response['contributor'] = False
    if "bb04281f-0f51-9921-c715-dcafa29ccb16" in role_ids:
        response['subscriptionCloudAdmin'] = True
    else:
        response['subscriptionCloudAdmin'] = False
    if "acdd72a7-3385-48ef-bd42-f606fba81ae7" in role_ids:
        response['reader'] = True
    else:
        response['reader'] = False

    return response

